function AddRecipe() {
    return (
        <form>
            <label>Add Recipe</label>
            <input type="text" placeholder="Recipe Name"/>
            <input type="url" placeholder="image"/>
            <input type="text" placeholder="ingredients" height="300px"/>
            <input type="text" placeholder="directions" height="300px"/>
            <button type="submit">Submit</button>

        </form>
    )
}
export default AddRecipe;
